import React from "react";
import jsPDF from "jspdf";
// import ResumeData from "../ResumeData";
const GenPDF = (props) => {
  //   genResume = () => {
  var doc = new jsPDF("p", "pt");

  doc.text(20, 20, props.doc);

  doc.save("Resume.pdf");

  //   return (
  //     // <>
